import React from "react";
import { Route, Switch, Redirect, Link } from "react-router-dom";

import Header from "./Header";
import Footer from "./Footer";
import Event from "./Event";
import ShowServiceList from "./ShowServiceList.js";
import Property from "./Property";
import Ledger from "./Ledger";
import AddEntry from "./AddEntry";
import Bills from "./Bills";
import MyEvents from "./MyEvents";
import { Complaints, PostComp, ResolveComp } from "./Complaints.js";
import { Housekeeping, RequestHousekeeping } from "./Housekeeping.js";
import QuartersBooking from "./QuartersBooking";
import ManageBooking from "./ManageBooking";
import AdminManageBookings from "./AdminManageBookings";

import './ManageBooking.css'; 

function Dashboard(props) {
  if (!props.user.username) {
    return <Redirect to="/login" />;
  } else {
    const { role, fname, lname, userid: id } = props.user;

    return (
      <div>
        <Header />
        <div style={{ margin: "10%" }}>
          <h1>Welcome back {fname + " " + lname}!</h1>
          <br />
          <ShowServiceList role={role} />
          <Link to="/quarter-bookings" className="btn btn-primary">
            View Quarter Bookings
          </Link>
        </div>
        <Footer />

        <Switch>
          <Route exact path="/dashboard" />
          
          <Route path="/dashboard/quarters-booking">
            <QuartersBooking user={props.user} />
          </Route>

          <Route path="/dashboard/manage-booking">
            {role === "admin" ? <AdminManageBookings /> : <ManageBooking />}
          </Route>

          <Route path="/dashboard/event/myevents">
            <MyEvents user={props.user} />
          </Route>

          <Route path="/dashboard/event">
            <Event user={props.user} />
          </Route>

          <Route path="/dashboard/property">
            <Property user={props.user} />
          </Route>

          <Route path="/dashboard/ledger/add">
            <AddEntry user={props.user} />
          </Route>

          <Route path="/dashboard/ledger">
            <Ledger user={props.user} />
          </Route>

          <Route path="/dashboard/bills">
            <Bills user={props.user} />
          </Route>

          <Route path="/dashboard/complaint">
            <div className="complaintLedger">
              <Complaints role={role} id={id} />
              <PostComp userid={id} />
            </div>
          </Route>

          <Route path="/complaint/resolve/:id" render={(props) => (
            <div>
              <Header />
              <div style={{ marginTop: "100px" }}>
                <center><h1>Resolve Complaints!</h1></center>
              </div>
              <ResolveComp {...props} className="resolvecomplaint" />
              <br /><br />
            </div>
          )} />

          <Route path="/dashboard/housekeeping">
            <div className="complaintLedger">
              <Housekeeping role={role} id={id} />
              <br /><br />
            </div>
          </Route>

          <Route path="/housekeeping/request/:uid/:sid" render={(props) => (
            <div>
              <Header />
              <div style={{ margin: "100px" }}></div>
              <RequestHousekeeping {...props} id={id} role={role} className="resolvecomplaint" />
              <br />
            </div>
          )} />
        </Switch>
      </div>
    );
  }
}

export default Dashboard;
